import React, {useState} from 'react';

import Todo from './Todo';

export default function App(){
  const [todo, setTodo] = useState([]);

  return(
    <div>

    <Todo onSubmit={text => setTodo([{text, complete: false}, ...todo])}/>

    <div>
    {
      todo.map((text) => <div key={text}>{text}</div>)
    }

    </div>

    </div>
  );
};
